#include <iostream>
#include <iomanip>
#include <vector>
#include <array>
#include <set>

using namespace std;

//#define int long long

const long long INF = 1e9 + 7;
const int MAXN = 105;
const int N = 1e5 + 10;
const int MOD = 1e9 + 7;

int dp[MAXN][MAXN][MAXN];

void init_dp() {
    for (int i = 0; i < MAXN; ++i) {
        for (int j = 0; j < MAXN; ++j) {
            for (int k = 0; k < MAXN; ++k) {
                dp[i][j][k] = INF;
            }
        }
    }
}

signed main() {
    ios_base::sync_with_stdio(false);
    cin.tie(nullptr);
    cout.tie(nullptr);
    int n, m;
    cin >> n >> m;
    vector<int> a(n);
    for (int i = 0; i < n; ++i) {
        cin >> a[i];
    }
    init_dp();
    for (int i = 0; i < n; ++i) {
        for (int j = 1; j <= m; ++j) {
            dp[i][i][j] = (a[i] == j ? 0 : 1);
        }
    }
    for (int len = 2; len <= n; ++len) {
        for (int l = 0; l + len - 1 < n; ++l) {
            int r = l + len - 1;
            for (int col = 1; col <= m; ++col) {
                for (int mid = l; mid < r; ++mid) {
                    dp[l][r][col] = min(dp[l][r][col], dp[l][mid][col] + dp[mid + 1][r][col]);
                }
                if (a[l] == a[r]) {
                    if (len > 2) {
                        dp[l][r][col] = min(dp[l][r][col], dp[l + 1][r - 1][a[l]] + (a[l] == col ? 0 : 1));
                    } else {
                        dp[l][r][col] = min(dp[l][r][col], (a[l] == col ? 0 : 1));
                    }
                }
            }
        }
    }
    int ans = INF;
    for (int col = 1; col <= m; ++col) {
        ans = min(ans, dp[0][n - 1][col]);
    }
    cout << ans << '\n';
}

#include <bits/stdc++.h>

using namespace std;

#define rep(i,n) for (int i = 0, _n = (n); i < _n; i++)
#define repr(i,n) for (int i = (n) - 1; i >= 0; i--)
#define int64 long long
#define pb push_back

 
struct BigInteger {
	static const int BASE = 1000000000; // 10^9
	
	vector<int64> digits;
	
	BigInteger() {
		digits.clear();
		digits.pb(0);
	}
	BigInteger(int64 number) {
		digits.clear();
		do {
			digits.pb(number % BASE);
			number /= BASE;
		} while (number);
	}
	
	BigInteger operator + (const BigInteger &b) const {
		BigInteger res = BigInteger();
		res.digits.resize(max(b.digits.size(), digits.size()));
		int64 remainder = 0;
		rep(i, res.digits.size()) {
			if (i < int(digits.size())) remainder += digits[i];
			if (i < int(b.digits.size())) remainder += b.digits[i];
			res.digits[i] = remainder % BASE;
			remainder /= BASE;
		}
		while (remainder) {
			res.digits.pb(remainder % BASE);
			remainder /= BASE;
		}
		return res;
	}
	
	BigInteger operator * (const BigInteger &b) const {
		BigInteger res = BigInteger();
		res.digits = vector<int64>(b.digits.size() + digits.size() - 1, 0);
		rep(i, digits.size()) rep(j, b.digits.size())
			res.digits[i + j] += digits[i] * (int64)b.digits[j];
		int64 remainder = 0;
		rep(i, res.digits.size()) {
			remainder += res.digits[i];
			res.digits[i] = remainder % BASE;
			remainder /= BASE;
		}
		while (remainder) {
			res.digits.pb(remainder % BASE);
			remainder /= BASE;
		}
		return res;
	}
	
	void print() {
		printf("%lld", digits.back());
		repr(i, (int)digits.size() - 1) printf("%09lld", digits[i]);
	}
	
	static BigInteger power(const BigInteger &b, int64 k) {
		if (k == 0) return BigInteger(1);
		if (k == 1) return b;
		BigInteger res = power(b, k / 2);
		res = res * res;
		if (k & 1) return res * b;
		return res;
	}
};

BigInteger dp[1001][1001];
bool cached[1001][1001];

BigInteger solve(const int &n, int idx, int sum) {
	if (sum <= 0) {
		return BigInteger(sum == 0);
	}
	BigInteger &ret = dp[idx][sum];
	if (cached[idx][sum])
		return ret;
	
	ret = 0;
	for (int i = 1; i <= 4; i++) {
		ret = ret + solve(n, idx + 1, sum - ((i - 1) % 3 + 1));
	}
	cached[idx][sum] = true;
	return ret;
}

int main() {
	int n;
	while (scanf("%d", &n) != EOF) {
		BigInteger ans = solve(n, 0, n);
		ans.print();
		puts("");
	}
	return 0;
}

#include <iostream>
#include <iomanip>
#include <vector>
#include <array>
#include <set>

using namespace std;

#define int long long

const long long INF = 1e18 + 7;
const int MAXN = 1e5 + 100;
const int N = 1e5 + 10;
const int MOD = 1e9 + 7;

array<int, 4 * MAXN> tree, upd, simple;
array<int, MAXN> a;

void build(int x, int lx, int rx) {
    if (lx + 1 == rx) {
        tree[x] = a[lx] * (lx + 1);
        simple[x] = a[lx];
        return;
    }
    int mid = (rx + lx) / 2;
    build(2 * x + 1, lx, mid);
    build(2 * x + 2, mid, rx);
    tree[x] = tree[2 * x + 1] + tree[2 * x + 2];
    simple[x] = simple[2 * x + 1] + simple[2 * x + 2];
}

void push(int x, int lx, int rx) {
    if (lx + 1 != rx) {
        upd[2 * x + 1] += upd[x];
        upd[2 * x + 2] += upd[x];
    }
    int a1 = lx + 1, an = rx, n = rx - lx;
    tree[x] += upd[x] * (((a1 + an) * n) / 2);
    simple[x] += (rx - lx) * upd[x];
    upd[x] = 0;
}

void update(int x, int lx, int rx, int l, int r, int d) {
    push(x, lx, rx);
    if (lx >= r || rx <= l) {
        return;
    }
    if (lx >= l && rx <= r) {
        upd[x] += d;
        push(x, lx, rx);
        return;
    }
    int mid = (rx + lx) / 2;
    update(2 * x + 1, lx, mid, l, r, d);
    update(2 * x + 2, mid, rx, l, r, d);
    tree[x] = tree[2 * x + 1] + tree[2 * x + 2];
    simple[x] = simple[2 * x + 1] + simple[2 * x + 2];
}

int sum(int x, int lx, int rx, int l, int r) {
    push(x, lx, rx);
    if (lx >= r || rx <= l) {
        return 0;
    }
    if (lx >= l && rx <= r) {
        return tree[x] - simple[x] * l;
    }
    int mid = (rx + lx) / 2;
    return sum(2 * x + 1, lx, mid, l, r) + sum(2 * x + 2, mid, rx, l, r);
}

signed main() {
    ios_base::sync_with_stdio(false);
    cin.tie(nullptr);
    cout.tie(nullptr);
    int n, m;
    cin >> n >> m;
    for (int i = 0; i < n; ++i) {
        cin >> a[i];
    }
    build(0, 0, n);
    for (int i = 0; i < m; ++i) {
        int type, l, r;
        cin >> type >> l >> r;
        --l;
        if (type == 1) {
            int d;
            cin >> d;
            update(0, 0, n, l, r, d);
        } else {
            cout << sum(0, 0, n, l, r) << '\n';
        }
    }
}

#include <iostream>
#include <iomanip>
#include <vector>
#include <array>
#include <set>

using namespace std;

#define int long long

const long long INF = 1e18 + 7;
const int MAXN = 1e5 + 100;
const int N = 1e5 + 10;
const int MOD = 1e9 + 7;

int dp[MAXN][3];
array<int, MAXN> color, used;
vector<vector<int>> g;

void dfs(int v, int p) {
    used[v] = true;
    array<int, 3> mx = {1, 1, 1};
    for (auto to: g[v]) {
        if (!used[to]) {
            dfs(to, v);
        }
        if (to != p) {
            mx[0] *= (dp[to][1] + dp[to][2]) % MOD;
            mx[0] %= MOD;

            mx[1] *= (dp[to][0] + dp[to][2]) % MOD;
            mx[1] %= MOD;

            mx[2] *= (dp[to][0] + dp[to][1]) % MOD;
            mx[2] %= MOD;
        }
    }
    if (color[v] != -1) {
        dp[v][color[v]] = mx[color[v]];
    } else {
        dp[v][0] = mx[0];
        dp[v][1] = mx[1];
        dp[v][2] = mx[2];
    }
}

