        int u, v;
        cin >> u >> v;
        --u, --v;
        g[u].emplace_back(v);
        g[v].emplace_back(u);
    }
    color.fill(-1);
    for (int i = 0; i < k; ++i) {
        int v, col;
        cin >> v >> col;
        --v, --col;
        color[v] = col;
    }
    dfs(0, -1);
    cout << ((dp[0][0] + dp[0][1]) % MOD + dp[0][2]) % MOD << '\n';
}
